import React from 'react';
import { createRoot } from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

// Crea una raíz de React utilizando la función createRoot y el elemento con el ID 'root'
const root = createRoot(document.getElementById('root'));

// Renderiza la aplicación dentro de un componente StrictMode
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Mide el rendimiento de la aplicación y registra los resultados
reportWebVitals();
